import React from 'react';
import Square from './square';

const Board = () => {
    return(



        <div className='Board-container'>
            <div className='row-container'>
                <Square value='0' />
                <Square value='1' />
                <Square value='2' />
            </div>
            <div className='row-container'>
                <Square value='3' />
                <Square value='4' />
                <Square value='5' />
            </div>
            <div className='row-container'>
                <Square value='6' />
                <Square value='7' />
                <Square value='8' />
            </div>
        </div>
    );
};

export default Board;
